              duration: 1500,
              easing: 'linear',
              step: function (now) {
                $this.text(Math.ceil(now).toString().replace(/(\d)(?=(\d{3})+(?!\d))/g, '$1,'))
              }
            });
          });
          $('.stat-animate-time').each(function () {
            var $this = $(this);
            jQuery({ Counter: 0.30 }).animate({ Counter: 4.30 }, {
              duration: 1500,
              easing: 'linear',
              step: function (now) {
                $this.text("0"+Math.ceil(now*10)/10 + "0")
              }
            });
          });
        }
      }
    }

    function modalVideoplay(obj){
      // $('#popup-youtube-player-preview').attr('src','').attr('src','https://www.youtube.com/embed/'+$(obj).attr('data-vdo')+'?autoplay=1&rel=0')
      $('#YoutubePlayerModal .modal-body iframe').remove();
      $('#YoutubePlayerModal .modal-body').append("<div id='popup-youtube-player-preview'></div>");
      player = new YT.Player('popup-youtube-player-preview', {
        width: '100%',
        videoId: $(obj).attr('data-vdo'),
        playerVars: { 'autoplay': 1},
        events: {
          'onReady': onPlayerReady
        }
      });
      $('#YoutubePlayerModal').modal('show');
    }

    function modalVideoplayMobile(obj){
      let title = $('.yt-desc-title', obj).text();
      let text = $('.yt-desc-detail', obj).text();
      $('#YoutubePlayerModal .modal-body iframe').remove();
      $('#YoutubePlayerModal .modal-body').append("<div id='home-video-mobile'></div>");
      $('#YoutubePlayerModal .modal-body').append(`<div id='yt-desc' style="letter-spacing: 0.2px;padding: 0px 10px;font-size: 16px;font-weight: 500;">${title}</div>`);
      $('#YoutubePlayerModal .modal-body').append(`<div id='yt-desc-small' style="letter-spacing: 0.2px;padding: 0px 10px 10px 10px;font-size: 12px;color: #99a6a4;font-weight: 300;">${text}</div>`);
      player = new YT.Player('home-video-mobile', {
        width: '100%',
        videoId: $(obj).attr('data-vdo'),
        playerVars: { 'autoplay': 1},
        events: {
          'onReady': onPlayerReady
        }
      });
      $('#YoutubePlayerModal').modal('show');
    }

    function onPlayerReady(event) {
      event.target.setVolume(100);
      // event.target.mute();
      event.target.playVideo();
    }

    function eventAction(event){
      if(event.data == 1 || event.data == 3){ // 1,3 play
        swiper6.autoplay.stop();
      }else if(event.data == 2 || event.data == 0){ // 0 end video , 2 stop, 
        swiper6.autoplay.start();
      }
    }

