          lineURL: 'https://line.me/ti/p/~%40txw7722f'
      });
    }
        // /Javascript ES6
    // Login slide banner
    loginModal = {
      firstLogin : 0,
      tempBannerStats: [],
      openFirstLogin () {
        $('#loginModal .banner-login-list').slick({
            arrows: false,
            autoplay: true,
            autoplaySpeed: 2000,
        });

        let bannerId = $('#loginModal .banner-item.slick-active').first().attr('data-bannerId');
        if(parseInt(bannerId) > 0){
          this.bannerStats(bannerId);
        }else{
          bannerId = $('#loginModal .banner-item').eq(2).attr('data-bannerId');
          this.bannerStats(bannerId);
        }

        $('#loginModal .banner-login-list').on('afterChange', function(event, slick, currentSlide){
            let bannerId = $('#loginModal .banner-item.slick-active').attr('data-bannerId');
            if(parseInt(bannerId) > 0){
              loginModal.bannerStats(bannerId);
            }
        });
      },
      closeLoginModal () {
        $('[banner-login-slide]').show();
        $('[banner-login-chat]').hide();
        $('#loginModal .banner-login-list').slick('slickPause');
      },
      bannerStats(bannerId) {
        let checkStatus = true;
        this.tempBannerStats.forEach(element => {
          element === bannerId
          ? checkStatus = false : '';
        });

        if (checkStatus === true) {
	        updateView('banner', 'ban_view', 'ban_id', bannerId, 'ban_lastupdate');
          banner_hits_stats(bannerId, 'search', ''); //update_banner_id => banner all stats
          this.tempBannerStats.push(bannerId);
        } 
      }
    }

    $('#loginModal .btn-close').click(() => {
      loginModal.closeLoginModal();
    })

    // END Login slide banner
    $(document).on('show.bs.modal', '#loginModal.modal', function () {
      if (loginModal.firstLogin == 0) {
        loginModal.firstLogin = 1;
        setTimeout(() => {
          loginModal.openFirstLogin();
        }, 500);
      }else{
        $('#loginModal .banner-login-list').slick('slickPlay');
      }
    });  


    // Filter add overlay 
    $('#frm-search-top [data-toggle="dropdown"]').parent().on('show.bs.dropdown', function () {
      $('body').addClass('search-option-hover')
    });

    $('#frm-search-top [data-toggle="dropdown"]').parent().on('hide.bs.dropdown', function () {
      $('body').removeClass('search-option-hover')
    });


    var privacyScroll = false
