        backdrop: true
      });
      return false
    }else{
      window.location.href='https://www.livinginsider.com/compare.php'
    }
  }

  // Assets Request
  const assetsRequest = {
    _cookie : $.cookie('living_client_tracking') ? JSON.parse($.cookie('living_client_tracking')) : '',
    _privacy : $.cookie('_privacy') ? JSON.parse($.cookie('_privacy')) : '',
    base_url : window.location.origin ,
    host : window.location.host ,
    current : window.location.pathname ,
    date : date = new Date(),
    form : { phone : '' },
    
    starter (_mode) {
      let time = 500;
      // Check Expire Date
      if (_mode == '') return false;
      if (this._privacy == '' || this._privacy == '0') {return false}
      if (this._cookie.formClose == 1) return this.checkExpireDate('close');
      if (this._cookie.formSubmit == 1) return this.checkExpireDate('submit');
      if (this._cookie.formClose == 0 || this._cookie.formClose == undefined  && this._cookie.formSubmit == 0 || this._cookie.formSubmit == undefined) {
        check = this.checkExpireDate('expire');
      } 

      if (check == false) {
        // Timer countdown 5sec to show
        setTimeout(()=> {
          if (_mode == 1) {
            // Zone
            $('#popupAssetsRequestzone').length != 0 && $('#popupAssetsRequestzone').length != undefined
            ? $('#popupAssetsRequestzone').fadeIn(time) 
            : $('#assets-request-zone').modal('show') ;
          } else if (_mode == 2) {
            // Project
            $('#popupAssetsRequestproject').length != 0 && $('#popupAssetsRequestproject').length != undefined
            ? $('#popupAssetsRequestproject').fadeIn(time) 
            : $('#assets-request-project').modal('show');
          } else {
            return false;
          }
        }, 5000)
      }
    },
    removeCookie () {
      this._cookie = null;
      $.removeCookie('living_client_tracking', {'path': '/'})
      return true;
    },
    checkExpireDate (type) {
      let dateExpire = '';
      switch (type) {
        case 'close':
          dateExpire = new Date(this._cookie.dateClose);
          dateExpire <= this.date ? this.removeCookie() : '';
          break;
        case 'submit':
          dateExpire = new Date(this._cookie.dateSubmit);
          dateExpire <= this.date ? this.removeCookie() : '';
          break;
        case 'expire':
          let dateCookie = new Date(this._cookie.date);
          dateExpire = new Date(dateCookie.setDate(dateCookie.getDate() + 3));
          return dateExpire <= this.date ? this.removeCookie() : false;
          break;
        default:
          break;
      }
      return true;
    },
    setExpireDate (day) {
      let date = new Date(this.date.setDate(this.date.getDate() + day));
      return date.getFullYear() + '-' + ("0"+(date.getMonth()+1)).slice(-2) + '-' + ("0"+(date.getDate())).slice(-2);
    },
    handleClose (elementId) {
      // let date = new Date();
     
      this._cookie.dateClose = this.setExpireDate(1);
      this._cookie.formClose = 1;

      this._cookie.currentTracking = null;
      this._cookie.tracking = null;
      this._cookie.page = 0;
      // save Cookies
      this.saveCookies();
      $(elementId).fadeOut(500);

    },
    
    handleClickAgree (e) {
      let _mode = $(e).data('mode');
      let $zone_id = $('#asrq-zone-id').val();
      let $project = $('#asrq-project-id').val();
      let $building = $('#asrq-post-prop').val();
      let $posttype = $('#asrq-post-type').val();
      let $price_id = $('#asrq-post-price').val();

      this.form.zone = $zone_id;
      this.form.project = $project;
      this.form.building_type = $building;
      this.form.posttype = $posttype;
      this.form.price_id = $price_id;
      this.form.priority = 1;
      this.form.flag = _mode;

      
      // _mode == 1  Zone
      // _mode == 2  Project
      if (_mode == 1) {
        let id_modal = '#assets-request-zone';

        $('#assets-request-zone').modal('show');
        $('#popupAssetsRequestzone').fadeOut(500);

        $(id_modal + ' .asrq-title').html('คุณกำลังค้นหาสิ่งนี้ใช่ไหม');
        $(id_modal + ' .asrq-sub-title').html('หากไม่ใช่ กำหนดใหม่เลยสิ');
        $(id_modal + ' #block-professional').css('display' , 'none');
        $(id_modal + ' .asrq-img-dicision').css('display', 'none');
        $(id_modal + ' .modal-footer').css('display', 'none');
        $(e).parent().css({
          'display':'none'
        })
        $('.asrq-agree-condition-zone').css({
          'display':'block'
        })
        $('.blog-second-2-zone').css({
          'display':'block'
        })
        
        $(id_modal + ' .asrq-posttype-zone [data-key="'+$posttype+'"]').addClass("active-select");
        $(id_modal + ' .asrq-rankprice-zone [data-key="'+$price_id+'"]').find('a').addClass('active-select');

      } 
      else if (_mode == 2) {
        let id_modal = '#assets-request-project';

        $('#assets-request-project').modal('show');
        $('#popupAssetsRequestproject').fadeOut(500);

        $(id_modal + ' .asrq-title').html('คุณกำลังค้นหาสิ่งนี้ใช่ไหม');
        $(id_modal + ' .asrq-sub-title').html('หากไม่ใช่ กำหนดใหม่เลยสิ');
        $(id_modal + ' #block-professional').css('display' , 'none');
        $(id_modal + ' .asrq-img-dicision').css('display', 'none');
        $(id_modal + ' .modal-footer').css('display', 'none');

        $(e).parent().css({
          'display':'none'
        })
        $('.asrq-agree-condition-project').css({
          'display':'block'
        })
        $('.blog-second-2-project').css({
          'display':'block'
        })

        $(id_modal + ' .asrq-posttype-project [data-key="'+$posttype+'"]').addClass("active-select");
        $(id_modal + ' .asrq-rankprice-project [data-key="'+$price_id+'"]').find('a').addClass('active-select');

      }

    },
    handleChangeZone (obj, val) {
      var _text = $('p',obj).html()
      var _img = $(obj).attr('data-picture')
      $('.asrq-img-zone img').attr('src', `https://livinginsider.com/upload/mod_zone/thumbnails_${_img}`)
      $('.asrq-list-zone .dropdown-action p').html(_text);
      $('.asrq-show label').html(_text)
      this.form.zone = val;
    },
    handleChangeProperty (obj, val) {
      var _icon = $('img',obj).attr('src')
      var _text = $('p',obj).html()
      $('.asrq-property-zone .dropdown-action img').attr('src',_icon)
      $('.asrq-property-zone .dropdown-action p').html(_text);
      this.form.building_type = val;
      // this.form.pottype = val;

      this.nextStepSave(1)
    },
    handleChangeExpireDate (obj, val) {
      var _text = $('p',obj).html()
      $('.asrq-form-notification .dropdown-action p').html(_text);
      $('#asrq-post-expire').val(val)
      this.form.priority = val;

    },
    handleNextForm (_mode) {
      if (_mode == 1) {
        let id_modal = '#assets-request-zone';
        $(id_modal + ' #block-professional').css('display' , 'none');
        $(id_modal + ' .asrq-img-dicision').css('display', 'none');
        $(id_modal + ' .asrq-title').html('ต้องการให้ผู้เชี่ยวชาญ ส่งข้อมูลให้คุณทางไหนดี');
        $(id_modal + ' .asrq-sub-title').hide();

        $(id_modal + ' .blog-second-2-zone').css({'display':'none'})
        $(id_modal + ' .asrq-save-contact-zone').css({'display':'block'})
        $(id_modal + ' .asrq-zone').hide();

      } else if (_mode == 2) {
        let id_modal = '#assets-request-project';
        $(id_modal + ' #block-professional').css('display' , 'none');
        $(id_modal + ' .asrq-img-dicision').css('display', 'none');
        $(id_modal + ' .asrq-title').html('ต้องการให้ผู้เชี่ยวชาญ ส่งข้อมูลให้คุณทางไหนดี');
        $(id_modal + ' .asrq-sub-title').hide();

        $(id_modal + ' .blog-second-2-project').css({'display':'none'})
        $(id_modal + ' .asrq-save-contact-project').css({'display':'block'})
        $(id_modal + ' .asrq-project').hide();
      }
    },
    handlePrevent (_mode) {
      if (_mode == 1) {
        let id_modal = '#assets-request-zone';
        $(id_modal + ' .asrq-img-dicision').css('display', 'none');
        $(id_modal + ' .asrq-title').html('คุณกำลังค้นหาสิ่งนี้ใช่ไหม');
        $(id_modal + ' .asrq-sub-title').html('หากไม่ใช่ กำหนดใหม่เลยสิ');
        $(id_modal + ' .asrq-sub-title').show();

        $(id_modal + ' .blog-second-2-zone').css({'display':'block'})
        $(id_modal + ' .asrq-save-contact-zone').css({'display':'none'})
        $(id_modal + ' .asrq-zone').show();

      } else if (_mode == 2) {
        let id_modal = '#assets-request-project';
        $(id_modal + ' .asrq-img-dicision').css('display', 'none');
        $(id_modal + ' .asrq-title').html('คุณกำลังค้นหาสิ่งนี้ใช่ไหม');
        $(id_modal + ' .asrq-sub-title').html('หากไม่ใช่ กำหนดใหม่เลยสิ');
        $(id_modal + ' .asrq-sub-title').show();

        $(id_modal + ' .blog-second-2-project').css({'display':'block'})
        $(id_modal + ' .asrq-save-contact-project').css({'display':'none'})
        $(id_modal + ' .asrq-project').show();
      }
    },
    handleInputForm (_mode, obj) {
      if (_mode == 1 ) {
        this.form.name = $('#name-asrq-zone').val();
        this.form.phone = $('#telphone-asrq-zone').val();
        this.form.line = $('#line-asrq-zone').val();
        this.form.mail = $('#email-asrq-zone').val();
        this.form.note = $('#detail-asrq-zone').val();
      } else if (_mode == 2) {
        this.form.name = $('#name-asrq-project').val();
        this.form.phone = $('#telphone-asrq-project').val();
        this.form.line = $('#line-asrq-project').val();
        this.form.mail = $('#email-asrq-project').val();
        this.form.note = $('#detail-asrq-project').val();
      }

    },
    nextStepSave (_mode) {
      if(_mode==1){
        var _post = this.form.pottype;
        var _price = this.form.price_id;
      }else if(_mode==2){
        var _post = this.form.pottype;
        var _price = this.form.price_id;
      }
      if(_post!= "" && _price!=""){
          $('.next-accept-zone>a').removeClass('disabled').addClass('active-next')
          $('.next-accept-project>a').removeClass('disabled').addClass('active-next')
      }else{
          $('.next-accept-zone>a').removeClass('active-next').addClass('disabled')
          $('.next-accept-project>a').removeClass('active-next').addClass('disabled')
      }
    },
    assetsPosttype (val, obj, _mode) {
      if(_mode==1){
        $('.asrq-posttype-zone a').removeClass('active-select')
        $('#asrq-post-type').attr('value',val)
        $('#asrq-price-zone').val('') // clear value rank price when select posttype
      }else if(_mode==2){
        $('.asrq-posttype-project a').removeClass('active-select')
        $('#asrq-post-type').attr('value',val)
        $('#asrq-price-project').val('') // clear value rank price when select posttype
      }

      this.form.posttype = val;
      this.form.price_id = '';
      $(obj).addClass('active-select')
      $('.price-group-assets a').removeClass('active-select') // remove active select
      $('.price-group-assets').each(function(){
        var key = $(this).attr('data-type');
        if(val == 1 || val == 6){
            if(key == 'rent') $(this).addClass('hidden');
            if(key == 'sale') $(this).removeClass('hidden');
        }else if(val == 4){
            if(key == 'sale') $(this).addClass('hidden');
            if(key == 'rent') $(this).removeClass('hidden');
        }
      });
      this.nextStepSave(_mode)

    },
    assetsPriceSelect (val, obj, _mode) {
      if(_mode==1){
        $('.price-group-assets a').removeClass('active-select')
      }else if(_mode==2){
        $('.price-group-assets a').removeClass('active-select')
      }

      this.form.price_id = val;
      $(obj).addClass('active-select')
      this.nextStepSave(_mode)

    },
    submitAssetRequest (_mode = false) {

      let check_form = true;
      let text;

      let lengthPhone = this.form.phone != '' ? this.form.phone.length : 0;
      if (this.form.phone != '') {
        if (!/^[0]\s{0}[0-9]{1,10}/g.test(this.form.phone) || lengthPhone < 10) {
          !/^[0]\s{0}[0-9]{1,10}/g.test(this.form.phone) ? text = "ตัวอักษรแรกต้องเป็นเลข 0" : '';
          lengthPhone < 10 ? text = "กรุณากรอกให้ครบ 10 ตัวอักษร" : '';
          $('#telphone-asrq-project').parent().addClass("validate-warning")
          $('#telphone-asrq-zone').parent().addClass("validate-warning")
          $('#telphone-asrq-project').parent().parent().find('span.sup-input').html(text);
          $('#telphone-asrq-zone').parent().parent().find('span.sup-input').html(text);
          check_form = false;
        } else {
          $('#telphone-asrq-project').parent().removeClass("validate-warning")
          $('#telphone-asrq-zone').parent().removeClass("validate-warning")
          $('#telphone-asrq-project').parent().parent().find('span.sup-input').html('');
          $('#telphone-asrq-zone').parent().parent().find('span.sup-input').html('');
        }
      } else {
          $('#telphone-asrq-project').parent().removeClass("validate-warning")
          $('#telphone-asrq-zone').parent().removeClass("validate-warning")
          $('#telphone-asrq-project').parent().parent().find('span.sup-input').html('');
          $('#telphone-asrq-zone').parent().parent().find('span.sup-input').html('');
      }

      if (_mode == 1) 
      {
        this.form.name = $('#name-asrq-zone').val();
        this.form.mail = $('#email-asrq-zone').val();

        if (this.form.name == '' || this.form.name == undefined ) {
          $('#name-asrq-zone').parent().addClass("validate-error")
          check_form = false;
        } else {
          $('#name-asrq-zone').parent().removeClass("validate-error")
        }

        if (/^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/.test(this.form.mail))
        {
          $('#email-asrq-zone').parent().removeClass("validate-error")
        }else {
          $('#email-asrq-zone').parent().addClass("validate-error")
          check_form = false;
        } 
      }else if (_mode == 2) {
        this.form.name = $('#name-asrq-project').val();
        this.form.mail = $('#email-asrq-project').val();

        if (this.form.name == '' || this.form.name == undefined ) {
          $('#name-asrq-project').parent().addClass("validate-error")
          check_form = false;
        } else {
          $('#name-asrq-project').parent().removeClass("validate-error")
        }

        if (/^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/.test(this.form.mail))
        {
          $('#email-asrq-project').parent().removeClass("validate-error")
        }else {
          $('#email-asrq-project').parent().addClass("validate-error")
          check_form = false;
        }
      }
      

      if (check_form == true) {
        this.ajaxSaveAssetRequest();
      }
    },
    ajaxSaveAssetRequest () {
      $('.asrq-overlay').show();
      $.ajax({
        url : 'https://www.livinginsider.com//a_assets_request.php',
        cache : false , 
        dataType : "json",
        method : "post" ,
        data : this.form,
      })
      .done(function(res){
        if (res['status'] == true) {
          
          $('#assets-request-zone').modal('hide');
          $('#assets-request-project').modal('hide');
          assetsRequest.success();
        }
      })
      
    },
    saveCookies () {
      if(this.host == 'www.livinginsider.com' || this.host == 'test.livinginsider.com'){
        $.cookie('living_client_tracking', JSON.stringify(this._cookie), {
          expires : 45,  
          domain : '.livinginsider.com',
          path : '/'
        });
      }else{
        $.cookie('living_client_tracking', JSON.stringify(this._cookie), { 
          expires : 45,  
          domain  : 'localhost',
          path : '/'
        });
      }
    },
    success () {
      $('#assets-success').modal('show')
      this._cookie.dateSubmit = this.setExpireDate(1);
      this._cookie.formSubmit = 1;

      this._cookie.currentTracking = null;
      this._cookie.tracking = null;
      this._cookie.page = 0;

      this.saveCookies();
    }

  }
</script>

